package udo.util;

public class NoFilenameException extends Exception {

	/**
	 * Auto-Generated serial version UID
	 */
	private static final long serialVersionUID = -1805968061658468764L;

	public NoFilenameException() {
	}

	public NoFilenameException(String message) {
		super(message);

	}

	public NoFilenameException(Throwable cause) {
		super(cause);

	}

	public NoFilenameException(String message, Throwable cause) {
		super(message, cause);

	}

	public NoFilenameException(String message, Throwable cause,
			boolean enableSuppression, boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);

	}

}
